import React,{useEffect,useState} from 'react'
export default function SearchFilter(){
    const[data,setData]=useState([])
    useEffect(()=>{
    const fetchData=()=>{
        fetch('https://jsonplaceholder.typicode.com/users')
            .then(response => response.json())
            .then(json => 
                {setData(json)
                })
    }
    fetchData();
},[])
return(
    <div>
        <table>
            <th>name</th>
            <th>User name</th>
            <th>Email</th>
            <th>Phone</th>
            {
                data.map(item =>{
                    return(
                        <tr>
                            <td>{item.name}</td>
                        </tr>
                    )
                })
            }
        </table>
    </div>
)
}
